import React from 'react';
import './App.css';
import {
  Switch,
  Route,
} from "react-router-dom";
import AdminPanel from './Pages/AskQuestionPage';
import HomePage from './Pages/HomePage';


function App() {
  return (
    <div className="App">
      <Switch>
      <Route exact path='/' component={AdminPanel}/>
    </Switch>
    </div>
  );
}


export default App;
